import React from 'react';

function MainContent() {
	let state = {
	  todos: [
	    {
	      id : 1,
	      title : 'Take Out the trash',
	      completed : false,
	    },
	    {
	      id : 2,
	      title : 'Take Out the trash',
	      completed : false,
	    },
	    {
	      id : 3,
	      title : 'Dinner at home',
	      completed : false,
	    },
	    {
	      id : 4,
	      title : 'New Learning On React',
	      completed : false,
	    }
	  ]
	}

	const items = state.todos.map((item, key) =>
    <li key={item.id}>{item.title}</li>
	);

	return (
		<ul>
			{items}
		</ul>
	)	
}

export default MainContent;
